import {createTheme} from "@mui/material";
import "./theme.css"
const theme= createTheme({
    typography:{
        h3:{
            fontSize: "3rem",
            fontWeight: 500
        },
        h5:{
            fontFamily: "Ultra",
            fontSize: "3rem",
            color: "#EF7B45",
        },
        h6: {
            fontFamily: "Ultra",
            fontSize: "1.5rem",
        }
    }
})

export default theme
